@Component
struct ClickEventExample {
  build() {
    Button('Click me')
      .onClick((event: ClickEvent) => {
        console.log('Button clicked', event)
      })
  }
}

@Component
struct LongPressEventExample {
  build() {
    Button('Long press me')
      .onLongPress((event: LongPressEvent) => {
        console.log('Button long pressed', event)
      })
  }
}

